#This solution has a small stack size

import timeit
import math

def answer(n):
	squaresReversed = getSquareList(n)[::-1]
	return searchLeastItems(n,squaresReversed)

def memoize(func):
	memo = {}
	def helper(input1,input2):
		if (input1,input2[0]) not in memo:
			memo[(input1,input2[0])] = func(input1,input2)
		return memo[(input1,input2[0])]
	return helper

def getSquareList(n):
	squares = []
	for i in range(int(math.sqrt(n)) + 1): #round down
		squares.append(i*i)
	return squares 

def searchLeastItems(n,squaresReversed):
	numberItems = 0

	guessTest = False
	if len(squaresReversed) > 1:
		guessTest = n > squaresReversed[0]*3
	if n <= 0 or len(squaresReversed) <= 1 or guessTest:
		numberItems = 0 
	else:
		#side A skips the highest possible square
		nA = n #for clarity
		itemsA = searchLeastItems(n,squaresReversed[1:])

		#side B uses the highest possible square and allows it to be used again
		nB = n - squaresReversed[0]
		while len(squaresReversed) > 0 and squaresReversed[0] > nB:
			squaresReversed = squaresReversed[1:]
		itemsB = searchLeastItems(nB,squaresReversed) + 1

		if itemsA == 0:
			numberItems = itemsB
		else:
			numberItems = min([itemsA,itemsB])

	return numberItems

searchLeastItems = memoize(searchLeastItems)

